import React from 'react';

//videos로 검색결과를 받아서 보내줌
const VideoLiset = ({ videos }) => {
    const renderedVideos = videos.map(video => {
        return <p>video.id</p>;
    });

    return( 
    <div className='container'>
        <div className='row'>
            <div className='col'>
                {renderedVideos}
            </div>
        </div>
    </div>
    )
}

export default VideoList;
